import React, {Component} from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import Chip from '@material-ui/core/Chip';
import TrashIcon from '@material-ui/icons/Delete';
import CloseIcon from '@material-ui/icons/DeleteOutlined';
import KeyIcon from '@material-ui/icons/VpnKey';
import TabIcon from '@material-ui/icons/Apps';

import RestKey from './TableKeyComponent';

const styles = theme => ({
    config: {
        marginLeft: 'auto',
    },
});
function renderRestPath(classes,state,item,index) {
    var key=state.Path.other.rest[index];

    console.log("RestPath:",key,item,index);

    var onclick=() => state.Navigate.onClickPath(state,'rest',key);
    var title="'"+state.Path.other.rest[index]+"'";
    return <RestKey classes={classes} state={state} key={`rest-${key}`} index={index} onclick={onclick} title={title} value={key}/>;
}
class RestPath extends Component {
    state={anchor:null};
    render() {
       const { classes, state } = this.props;
       var items=state.Path.other.rest;
       var mapFunction= (item,index)=>renderRestPath(classes,state,item,index);
       return items.map(mapFunction);
    }
};

RestPath.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(RestPath);
